css:
.etch-octicon,
.mega-etch-octicon {
  display: inline-block;
  line-height: inherit;
  margin-right: .2em;
  vertical-align: middle;
  fill: currentColor;
}
.etch-octicon svg,
.mega-etch-octicon svg {
  width: auto;
  height: 1em;
  vertical-align: text-top;
}
.etch-octicon.no-margin,
.mega-etch-octicon.no-margin {
  margin-right: 0;
}
.etch-octicon {
  font-size: 16px;
}
.mega-etch-octicon {
  font-size: 32px;
}
.etch-octicon.auto-size {
  font-size: 1em;
}
